  "text" : "ちなみに、なんでVisual Basic (for Applications)なのかというと、教えてる先生が水文学の先生で表計算ソフト使って統計処理ガリガリって先生だからという。まぁ、表計算ソフト使うだけでも十分な技術者って言える分野っていうのも否定出来ないところあるんで。。",
