  "id_str" : "126317734417022976",
  "text" : "まぁよく考えれば、自分がそこの学生だった頃にC言語の授業をしていた先生は定年退職されてしまって、あとの先生たちではプログラミング教えられなかったのかなぁと、仕方ないことなのかも。と思ったんですが、よく考えたら普通に地盤計算してる先生いるんですよね、Fortranで。",
