  "text" : "土木工学での流体系は、一部、橋梁工学とか水文学の先生で空気力学を扱っている人と、あとすごく一部でフレッシュコンクリートのレオロジーをやっている人を除けば、あとはみんな水理学の人です。でも水理学と言っても河川・海岸・地下水と幅広いので、純粋な流体の人から見たら奇妙なんでしょうね。",
