  "text" : "工学系において：建築は意匠設計で女の子が多い。物理はロケット＆ロボットに惹かれる女の子が多い。化学は薬品とか理系っぽくて惹かれる女の子が多い。電気電子系はモノづくりっぽくて工作好きな女の子が多い。情報系はプログラマとか知的なので女の子が多い。土木系は女の子に好かれる要素がない。",
