  "text" : "ちょっと焦げ気味なのは、フライパンをちょっと熱しすぎたのと、いつもオムレツは卵液を入れたあとにかき回しながら焼くんで、焼き方がわからず「えっ、これは・・・？」みたいにしばらく固まってその後試行錯誤して折りたためばいいことに気づいたからです。",
