  "id_str" : "123072018961797120",
  "in_reply_to_user_id" : 75975397,
  "text" : "@fumiexcel 非公式RTというのは、公式RTと同じく他者の発言を自分の発言として扱って情報を広めるために使うもので、「RT @だれだれ はつげん」という形をしています。もともと歴史的経緯からすると非公式RTしかなかったのもあり、公式RTも本文は同じ形式になってます。",
