  "text" : "'''セルフデスマーチ'''とは、自分自身に起因する[[デスマーチ]]のこと。後ろ向きな意味では自分のミスや能力不足によって締め切り前に引き起こされるが、前向きには、締め切りのない仕事に自ら締め切りを設定し自身を追い込むことで仕事効率を高めることを指す{{要出典}}。 [n]",
  "id" : 120802470120271872,
